import React, { Component } from "react";
import "./Tutors.css";

class Tutors extends Component {
  render() {
      const { prof } =this.props;
    return (
      <div className="tutors">
        <p>Insert images here</p>
        <h1>{prof.name}</h1>
      </div>
    );
  }
}

export default Tutors;
